cc9f3814-794e-4056-b396-65f098f3ddf8	Names\nThe settlement of Akmoly was founded in 1830, possibly named after a local landmark—Ақ мола literally means white grave in Kazakh—although this theory is not universally accepted.[2] In 1832, it was granted town status and renamed Akmolinsk.[2] In 1961, under Nikita Khrushchev, it was renamed Tselinograd, Russian for "City of Virgin Lands".[23] In 1991, following Kazakhstan's independence, the name was changed to Akmola.[23]	{"doc_id": "cc9f3814-794e-4056-b396-65f098f3ddf8", "source": "test.txt", "dataset_id": "25e94280-777e-437e-90f9-f7d5366d6638", "chunk_index": 5, "chunk_total": 7}	[-0.0017598707,-0.034454945,-0.0012693119,0.034655914,-0.007614476,-0.04238204,-0.0049041915,-0.068463296,0.023535654,-0.034588926,0.007631223,-0.031172458,0.025232721,-0.027287066,-0.013643533,0.041399527,-0.03952382,0.006090464,-0.008535582,-0.0006646617,-0.030748192,-0.025790967,-0.041578166,0.012426557,0.007876852,-0.008557912,-0.021961398,-0.025612328,-0.004482716,-0.048768375,-0.002588866,-0.019181333,-0.02666183,-0.008183887,-0.041377198,-0.04675869,0.05783429,-0.016434763,0.0046501895,-0.040372353,-0.042761646,-0.0023404465,0.0041645155,0.018410955,-0.002933583,-0.0112821525,0.0008443471,0.025723977,0.02167111,0.01839979,0.014648376,-0.041377198,-0.01914784,-0.008457428,-0.0326239,-0.027443375,0.0075363214,-0.0030871006,0.04059565,0.0253667,0.0038993487,-0.0012323281,0.045709185,0.009261302,0.0019929383,-0.013766347,0.007095307,0.023022067,-0.018801726,0.05631586,-0.005066083,-0.034946203,0.015697878,-0.00048288284,-0.07735057,-0.0032880693,0.0026837678,0.0073688477,-0.0048232456,-0.022809934,-0.042984944,0.030457905,0.0070897248,-0.020789083,0.09378534,-0.036442302,0.019840064,-0.024272539,-0.0034611255,-0.025031753,-0.0281356,0.014369253,0.018790562,0.045820836,0.040394682,0.04934895,0.041846123,-0.01767407,9.120563e-06,0.004024954,-0.021626452,-0.051492617,0.030569553,0.020197341,-0.007603311,0.010762984,0.0007857313,0.010070759,0.