ee22cb3a-baac-44ff-a1fc-9bc12aa9e37b	Almaty,[a] formerly Alma-Ata,[b] is the largest city in Kazakhstan, with a population exceeding two million residents within its metropolitan area.[8] Located in the foothills of the Trans-Ili Alatau mountains in southern Kazakhstan, near the border with Kyrgyzstan, Almaty stands as a pivotal center of culture, commerce, finance and innovation. The city is nestled at an elevation of 700–900 meters (2,300–3,000 feet), with the Big Almaty and Small Almaty rivers running through it, originating from the surrounding mountains and flowing into the plains. Almaty is the second-largest city in Central Asia and the third-largest in the Eurasian Economic Union (EEU).	{"doc_id": "ee22cb3a-baac-44ff-a1fc-9bc12aa9e37b", "source": "test2.txt", "dataset_id": "378db333-eeca-4ec0-beb6-a28e24e26243", "chunk_index": 0, "chunk_total": 3}	[-0.049844597,-0.058261517,0.03151213,0.032374352,0.0038594662,-0.016454054,-0.044137515,0.0125124715,-0.020662514,-0.018137438,0.006122797,-0.041222386,0.022335635,-0.016998075,0.015129929,0.04220778,-0.03935424,-0.008093588,-0.021124419,-0.02108336,-0.040750217,-0.052800782,-0.035351068,-0.0036182497,0.018332465,-0.0056249667,-0.018373523,-0.008062795,0.020416167,-0.0029664515,0.0043803914,-0.012964112,-0.022294577,-0.038492016,-0.029459223,-0.039210536,0.03292864,-0.010120834,0.03955953,-0.012337974,-0.005660893,-0.013056492,-0.010285067,-0.011198611,0.0050321897,-0.029602928,0.027857956,-0.0021016642,0.013764746,0.015458394,-0.00059117324,-0.045738783,-0.016033208,-0.037814558,0.015827918,0.020303257,0.029910864,-0.02033405,0.029028114,0.022807803,-0.0018091248,0.037629798,0.011752896,0.012717763,-0.011660515,-0.022479339,0.021247594,0.018199027,-0.036254346,0.020036379,-0.014596173,-0.011937657,0.044589154,-0.012317445,-0.018897014,-0.021678705,-0.03935424,0.013959772,0.027426846,0.009766708,-0.035207365,0.016731197,-0.030814143,0.04861285,0.07489007,-0.07016838,-0.022171402,-0.0031358164,-0.009140571,-0.02479