d10c0b11-24d5-4b75-a3cb-976739d09bbb	Almaty served as the capital of Kazakhstan from 1929 to 1997 during the Soviet era and after independence from 1991 until the capital was relocated to Aqmola (now Astana) in 1997.[9] Despite no longer being the capital, Almaty remains the most cosmopolitan and influential city in Kazakhstan, often regarded as the nation's cultural and financial heart, and is colloquially referred to as the "Southern Capital". It is classified as a city of republican significance, granting it autonomy from regional governance.[10] The city is divided into eight administrative districts within the framework of its republican significance.	{"doc_id": "d10c0b11-24d5-4b75-a3cb-976739d09bbb", "source": "test2.txt", "dataset_id": "378db333-eeca-4ec0-beb6-a28e24e26243", "chunk_index": 1, "chunk_total": 3}	[-0.037727337,-0.04251811,0.022696286,0.003480796,0.03750776,-0.0024877086,-0.06794913,0.009546613,-0.0069316495,-0.023434864,-0.013653703,0.010819162,0.04096111,-0.016039109,-0.012096701,0.043077033,-0.051301192,0.019183053,-0.012096701,-0.033335794,-0.008448727,-0.052458964,-0.02365444,-0.026768444,0.017176917,0.021418747,-0.017037187,0.0034134258,0.023275172,-0.014921261,0.010879047,-0.020999555,-0.024632558,0.00835391,-0.012166567,0.0019225471,0.019252919,-0.037208337,-0.00018823122,-0.007809958,-0.019173073,0.009556594,-0.014811473,-0.00770516,-0.011557739,-0.04175957,-0.0024128528,0.014581915,0.007655256,0.030241754,0.0044564167,-0.039284337,0.0041470127,-0.029323522,0.010988835,0.008343929,0.005229927,0.0041320417,0.026389174,0.020191113,0.046430573,0.06283897,0.040561877,0.03764749,-0.0159393,-0.020390727,0.036290105,0.012475971,-0.024013748,0.030521216,-0.025291288,-0.011787297,0.034912758,0.010190373,-0.0400828,-0.01953238,-0.02273621,0.014452165,0.031559218,0.00019166211,-0.06758982,0.052498884,-0.00014417544,0.038266297,0.045392573,-0.055572964,-0.019292843,-0.004396532,0.006372726,-0.015220685,0.019232957,0.011148528,0.024333134,0.016089013