b7915b36-36af-42b3-9fd3-da0adbede95b	Almaty is globally recognized for hosting major international events, including the Alma-Ata Primary Healthcare Conference, which shaped global public health policy, the 2011 Asian Winter Games, and the 2017 Winter Universiade. The city was also a contender to host the 2022 Winter Olympics but ultimately lost the bid, further solidifying its position as a prominent international hub for winter sports.	{"doc_id": "b7915b36-36af-42b3-9fd3-da0adbede95b", "source": "test2.txt", "dataset_id": "378db333-eeca-4ec0-beb6-a28e24e26243", "chunk_index": 2, "chunk_total": 3}	[-0.05233721,-0.059724018,0.027008016,0.02486752,-0.00473742,-0.017113471,-0.06526413,0.010093905,0.00065447745,-0.049525186,0.0052515585,0.0012296045,-0.006279836,-0.024426831,-0.020471111,0.033303592,-0.045705874,0.023356583,-0.011216615,-0.025161315,0.016441943,-0.020964265,-0.023776287,-0.02111116,0.012056026,0.004548553,0.0023700215,-0.014395881,0.057373673,0.041277986,0.01647342,-0.02566496,-0.022097468,-0.029882995,0.011510409,-0.0057552047,0.014248984,0.0031005705,0.0029851517,-0.015476622,-0.002906457,-0.024237962,-0.026756193,0.03605266,0.019128054,0.027889397,-0.008425578,-0.028225161,0.019652685,0.039767046,0.031100139,-0.007323852,0.03494044,0.0048003756,0.030911272,0.007386808,0.034205955,-0.00031477874,0.038235124,0.0030481075,0.008902992,0.02003042,0.025056388,0.035842806,-0.00026805376,-0.031058168,0.043607347,0.010204078,0.007538951,0.021656778,0.0057079876,-0.014007654,0.06732068,-0.049105484,-0.044908434,0.016494406,-0.062494073,0.010870359,0.030239744,0.011877651,-0.053722236,0.070384525,0.0049761273,0.039032564,0.037878376,-0.069461174,-0.01619012,-0.023524465,-0.0047295503,0.014700167,-0.01675672,0.025685946,0.049399275,0.021341998,0.032716002,0.08444464,0.036031675,0.0039399806,-0.0077907736,-0.010660507,-0.009128584,-0.06820206,-0.02407008,0.017459728,-0.01786894,0.017375786,-0.033051766,-0.018435542,0.036451377,0.026609296,-0.044027053,-0.0456639