8e5ab29d-d57a-405b-9d4e-b39390afbc99	The city is renowned for its modern landmarks, including the Baiterek, which symbolizes Kazakhstan's independence, the Khan Shatyr Entertainment Center, and the Hazrat Sultan Mosque, one of the largest in Central Asia. The Palace of Peace and Reconciliation, designed to host cultural and interfaith events, highlights the city’s role as a hub for dialogue and cooperation. In 2021, Astana was recognized as one of Kazakhstan's 10 priority tourist destinations, reflecting its growing appeal. Visitors can explore cultural venues such as the Astana Opera and the National Museum of the Republic of Kazakhstan, alongside parks like Presidential Park and Central Park, which offer recreational spaces along the Ishim River.	{"doc_id": "8e5ab29d-d57a-405b-9d4e-b39390afbc99", "source": "test.txt", "dataset_id": "5f4cfa55-8026-428b-9afe-987694300027", "chunk_index": 2, "chunk_total": 7}	[-0.036255717,-0.04305915,-0.008509778,0.031976137,0.0028393362,-0.010578242,-0.073652655,0.013343508,-0.008125714,0.0026802237,-0.015395512,-0.013244749,0.035004765,-0.042576328,0.003643129,0.05148663,-0.042444646,-0.012290074,0.0020794366,0.0097168395,-0.017414596,-0.035136443,-0.02622614,-0.007313691,0.002142533,0.018259538,-0.03515839,0.035421748,0.060001895,0.02602862,-0.016295321,-0.011269559,-0.0057115923,-0.017985206,-0.008476859,-0.017787687,0.016470894,-0.05736831,0.028706102,-0.026006674,0.019532438,0.031164115,-0.032568697,-0.02230868,-0.0075880233,-0.011653624,0.03777003,0.006935113,0.0052040783,0.020487115,-0.020135969,-0.020157916,-0.030395987,-0.06092365,-0.0024154934,-0.0038379047,-0.0017173183,-0.039086822,-0.014824902,0.025370223,0.056183197,0.014890742,-0.012970417,0.03981106,-0.015395512,0.032305337,0.04235686,0.038911253,-0.005974951,0.02806965,0.04071087,0.009804626,0.0126412185,0.005996898,0.012816791,-0.0060188444,-0.0033907436,0.029408392,0.053066783,-0.024470415,-0.053286247,0.003804985,-0.029540071,0.051398844,0.02284637,-0.042005718,