271914f1-0bfb-4a4d-af39-ae1159ff2cd0	Astana’s history is marked by rapid growth, especially after becoming the capital.[17][18] Its transformation into a modern and planned city was guided by a master plan designed by Japanese architect Kisho Kurokawa.[19] Today, Astana is known for its futuristic architecture, housing key government institutions like the Akorda Residence, the Parliament House, and the Supreme Court.[20][21][22] It has become an important center for culture, education, and commerce in Kazakhstan and Central Asia.	{"doc_id": "271914f1-0bfb-4a4d-af39-ae1159ff2cd0", "source": "test.txt", "dataset_id": "6e2e5ea8-7138-4a76-858a-42f097890528", "chunk_index": 1, "chunk_total": 7}	[-0.045414824,-0.0551384,0.012446178,0.012560573,0.03354062,0.0019661644,-0.071794316,-0.023862801,-0.0016830368,-0.03816218,0.0136015685,-0.013166867,0.04337859,-0.055733256,-0.0183604,0.036492012,-0.05651114,-0.0029113533,0.010404227,-0.029399522,-0.030657867,-0.038894307,-0.0034547297,-0.02507539,0.007824619,-0.001861779,-0.025578728,0.011759808,0.039695073,-0.006966657,-0.01679319,-0.011239311,-0.028781788,-0.011536738,-0.013464294,-0.04154827,0.013075351,-0.017971458,0.026150702,-0.014756958,0.0039466284,1.503669e-05,-0.03354062,0.0029971497,0.005608216,-0.014917111,-0.009775055,0.046352863,-0.021517703,0.06337484,-0.014631123,-0.015683558,0.0046959156,-0.06840822,-0.034318507,0.021391869,0.0018789383,-0.036812317,0.0031658823,0.050882906,0.08277624,0.010758852,-0.009557704,0.075912535,-0.010318431,0.004547202,0.055092644,0.05975996,0.016713113,0.035782762,0.017102055,0.030040134,0.0009587733,0.009397551,0.0042840936,-0.030772261,-0.015534844,0.031321358,0.031344235,0.045666493,-0.031001052,0.0105701005,-0.05266747,0.027431926,0.036446255,-0.06703548,-0.019630186,-0.026722677,-0.032602582,-0.009037207,0.0071782875,0.04406496,0.004244055,-0.011988599,-0.0133613385,0.08579627,0.00712681,0.0075443517,0.017136374,-0.011222152,0.061636038,-0.07604981,-0.015912348,0.027203137,-0.00