6245c2b0-48c6-46a8-8c87-9c0f654d3628	Astana gained international recognition when it hosted the 2011 Asian Winter Games, an event that showcased the city’s ability to organize large-scale sporting events. The city also hosted Expo 2017, a major international exhibition focused on the theme of "Future Energy," which brought global attention to its commitment to sustainability and innovation. Astana is also home to the Congress of Leaders of World and Traditional Religions, a prominent event that brings together religious leaders from around the world to foster mutual understanding and peace.	{"doc_id": "6245c2b0-48c6-46a8-8c87-9c0f654d3628", "source": "test.txt", "dataset_id": "6e2e5ea8-7138-4a76-858a-42f097890528", "chunk_index": 3, "chunk_total": 7}	[-0.083678216,-0.08187443,0.023229284,0.007957569,0.00453147,0.007886078,-0.08253435,-0.0075561167,0.0008915833,-0.030246465,0.018191874,-0.02404319,-0.0034096013,-0.043070965,-0.023911204,0.06915992,-0.036647715,0.0030548929,-0.010217805,-0.026132945,0.01813688,-0.019357737,0.014023361,-0.014837265,0.018752808,0.012703515,-0.0299385,0.03002649,0.08112652,0.030576425,0.018114882,-0.014529302,-0.017828915,-0.0050594085,0.0029284076,0.008666987,0.03757161,-0.022525366,0.008452511,-0.00957988,-0.0009197675,-0.008529503,-0.046678543,0.032644182,0.0030136476,-0.0088539645,-0.030554429,-0.009629374,-0.007501123,0.053849705,0.029212585,-0.027452791,0.022811333,-0.027980728,-0.004943922,-0.009728363,0.014804269,-0.004047527,-0.011856614,0.015761157,0.022591358,-0.0035443357,0.040519264,0.05226589,-0.012274565,0.003907293,0.06440847,0.060008984,0.005023663,0.03807755,0.018950785,0.006824702,0.04122318,-0.009480892,-0.0033656065,-0.0093599055,-0.013275448,0.0064012515,0.035745822,0.014188341,-0.04672254,0.027562778,-0.041377164,0.0046387077,0.034162007,-0.065376356,-0.0021791202,-0.06080089,-0.0112076895,0.032556195,-0.0048779296,0.022503369,0.054949578,0.026748873,0.007594612,0.07571515,0.022569362,0.00530138,0.022899322,-0.0018