f06c8afe-c08c-487e-8607-c947352a53cf	Astana,[a] formerly known as Nur-Sultan, Akmolinsk, Tselinograd, and Akmola,[15] is the capital and the second-largest city of Kazakhstan with a population of 1,350,228 within the city limits after Almaty, which had been the capital until 1997.[16] Initially founded as Akmoly in 1830, the city was later renamed Akmolinsk, Tselinograd, and Akmola before adopting the name Astana in 1998, which means "capital city" in Kazakh.[16] In 2019, the city briefly adopted the name Nur-Sultan in honor of former president Nursultan Nazarbayev, but it returned to the name Astana in 2022.	{"doc_id": "f06c8afe-c08c-487e-8607-c947352a53cf", "source": "test.txt", "dataset_id": "f0217e6f-7f6c-4c0c-98e4-53fe25c09e3b", "chunk_index": 0, "chunk_total": 7}	[-0.042230096,-0.038076673,0.027073363,-0.007540312,0.026073063,-0.013938976,-0.0532769,-0.029291421,-0.0022262132,-0.030182995,-0.0043110796,-0.006404101,0.04075139,-0.023702784,-0.020060383,0.016700678,-0.04844936,-0.029465387,-0.012068848,-0.04449165,0.001150482,-0.042295333,-0.02457261,-0.01789669,0.02602957,0.010872836,-0.019668961,0.008497122,0.0085841045,-0.018679533,-0.018646915,-0.029639352,-0.035054024,-0.0054337,-0.022419788,-0.039076973,0.03822889,-0.04381753,0.0038462658,-0.014547856,-0.03427118,-0.012308051,-0.016309254,0.018494695,-0.008991836,-0.015439427,-0.012829947,0.0031286587,-0.006735722,0.027508276,-0.004186042,-0.061322797,-0.0007597394,-0.015450301,0.00021100098,0.01525459,0.018125018,0.0039577126,0.044404663,0.020614898,0.029073965,0.03181392,0.047753498,0.051232807,-0.0019340058,-0.036206547,0.07080391,0.03457562,0.0075348755,0.053059444,0.0026488947,-0.00535759,0.03024823,-0.012286305,-0.044752594,-0.026051316,-0.019408014,0.0026611267,0.045535438,0.0013910435,-0.04196915,0.054712113,-0.011818773,-0.0020767117,0.0658459,-0.057452068,-0.0015425837,-0.036554478,-0.0008949704,-0.036706697,-0.01655933,0.017907562,0.026964635,0.02457261,-0.015363318,0.073195934,0.05432069,-0.001