2ea8dd56-ebdb-45b9-b239-1bb2c7a904e7	In December 1997, the city replaced Almaty as the capital of Kazakhstan, and in May 1998, it was renamed Astana, which means "capital city" in Kazakh.[24] In March 2019, the capital was renamed to Nur-Sultan (/ˌnʊərsʊlˈtɑːn/;[11] Kazakh: Нұр-Сұлтан / Nūr-Sūltan [ˌnʊrsʊɫˈtɑn]) in honor of the long-ruling President Nursultan Nazarbayev, shortly after his resignation.[25][26] In September 2022, President Kassym-Jomart Tokayev signed a constitutional amendment to revert to the name Astana.[27][28] As of 2022, it holds the Guinness World Record for the capital city with the most name changes in modern times.[23]	{"doc_id": "2ea8dd56-ebdb-45b9-b239-1bb2c7a904e7", "source": "test.txt", "dataset_id": "f0217e6f-7f6c-4c0c-98e4-53fe25c09e3b", "chunk_index": 6, "chunk_total": 7}	[-0.048909705,-0.03773541,0.014056551,0.007754383,0.0007856925,0.014533233,-0.05520633,-0.012892563,-0.017360063,-0.019045075,-0.008807516,0.008813059,0.03352288,-0.03549612,0.00013259427,0.031061875,-0.050772086,0.003979733,-0.02259247,-0.046958636,-0.017348977,-0.041349318,-0.015364653,-0.0004718312,0.03387762,0.032458663,-0.004761269,0.01612956,0.036515996,-0.0110966945,0.017482005,-0.020519461,-0.017315721,0.014278264,-0.024100114,-0.040861554,0.02986463,-0.052590128,-0.01719378,-0.009361796,-0.0139346095,-0.010492529,-0.015785906,-0.020286664,-0.002336292,0.017504176,-0.008635689,0.010719784,0.002387563,0.029421205,-0.005196379,-0.030019827,-0.009167798,-0.026295064,-0.0008646775,0.0033617108,0.01375724,-0.00031732555,0.020197978,0.0050882944,0.034941837,0.028999953,0.029066466,0.041881427,-0.00044619574,-0.023235435,0.055117644,0.092853054,0.015320311,0.06190204,-0.0014480576,0.008098037,0.014821459,-0.012493481,-0.033944134,0.007560385,-0.012227426,0.023058066,0.0656268,-0.002618975,-0.04624916,0.021517167,-0.016063046,0.040528983,0.05471856,-0.015918933,0.0055899182,-0.023279777,0.027248425,-0.029465547,0.0039880476,0.012726278,0.009300825,-0.0057645165,-0.03