2261771c-a017-4150-bae6-470b84793171	The city’s transport infrastructure includes the Nursultan Nazarbayev International Airport, a key hub for both domestic and international flights. Astana is also well-connected by two railway stations, Astana-1 and Astana-Nurly Zhol, which provide services to major cities across Kazakhstan and beyond. The city's public transport system includes buses, and the planned Astana Light Metro system, currently under construction, is expected to significantly enhance the city’s transport network, offering efficient and sustainable travel within the city.\n\nAstana is home to notable educational institutions, such as Nazarbayev University, L.N. Gumilyov Eurasian National University, and Astana IT University, contributing to its role as a hub for education and innovation. These institutions support the city’s growth in technology, research, and higher learning, making Astana an increasingly important center for knowledge and progress in the region.	{"doc_id": "2261771c-a017-4150-bae6-470b84793171", "source": "test.txt", "dataset_id": "f166f7db-f371-49b9-8351-5b8286a25d56", "chunk_index": 4, "chunk_total": 7}	[-0.073101714,-0.04237749,-0.014459088,0.0014821909,0.02309154,-0.018511934,-0.04665609,0.043065507,-0.01452359,0.01620063,-0.034938317,0.010368618,0.018726937,-0.0050687436,-0.0049827415,0.016877895,-0.048935145,0.020264225,-0.008148691,-0.01835068,0.00050996506,-0.04054995,0.027649647,-0.05005317,0.00047301108,-0.036185347,0.015706118,0.004877927,-0.011707024,-0.0039560925,0.024188066,-0.022425026,-0.01574912,0.0044076033,0.0016246318,-0.01322281,0.021672508,0.010373993,0.023457048,-0.015469613,-0.007772432,-0.008707704,-0.026983133,-0.04996717,-0.030616717,0.022855036,0.014749345,-0.011298515,-0.0013720009,0.028875176,-0.025134088,-0.045882072,0.004875239,-0.085356995,0.015286858,0.03293877,-0.016340382,-0.037862387,-0.028552668,-0.006890911,0.024639577,-0.013943076,0.010637374,0.05340725,0.015480363,-0.01282505,0.0728007,0.0212102